VALUES
	(2,6,'redemouk','Welcome To Mverso','Mobile Marketing Automation','Zero to Mobile in 30 min ','mverso-estate-agent-s','We help you sell your property',70,71,75,'','Kenneth has been working on Mobile Marketing from 2003 being the first to bring to the market mobile marketing service, showing the service in Orlando National Association of Realtors in 2004. Then in 2010 he received the Patent US 7,643,821. Also he received in 2013 Patent US 8,437,453. He now brings a new service in digital mobile marketing in HTML5 with the new text & email service mVerso.','',0,0,'2013-03-02 21:51:35','2014-10-30 08:26:59','home_03.jpg','image/jpeg',76084,'2014-03-19 14:54:28',NULL,NULL,NULL,NULL,'mobi_logo_(1)_(1).png','image/png',11117,'2014-03-19 14:57:20','mobi_logo_(1)_(1).png','image/png',11117,'2014-03-19 14:57:20','<br>','',1,''),
	(5,7,'boresha','RESTORE. RECLAIM. REWARD.™','7-to-7 Lifestyle™','Transform Your Life Step by Step','boresha-coffee','Take a look at our exclusive line of fat-burning coffee, tea and supplements. A delectable, organic and powerful variety designed to support a balanced lifestyle.',30,39,38,'We are committed to developing products that are innovative and scientifically sound to make it easy to be healthy every day. It is our mission to bring to market innovative products that allow individuals to live healthier lives by maintaining and enhancing health as a part of your everyday life.\r\n\r\nBoresha science comes from a rich tradition of product innovation and the highest quality standards. We provide an excellent environment for an empowering business opportunity, so you can thrive physically, mentally and psychologically, every day.','As a Health and Wellness Company, we are committed to developing products that are innovative and scientifically sound to make it easy to be healthy every day.\r\n\r\n\r\nWe are dedicated to bring to market innovative products that allow individuals to live healthier lives by maintaining and enhancing health as a part of everyday life.\r\n\r\nThe culture Boresha has grown into is a strong, commitment-driven community of people helping others to succeed. “Excellence” is defined differently for different people, and we are about “manifesting excellence at every level”. At Boresha, we want to celebrate each individual’s success. At Boresha, our purpose is to help you get the tools to transform your life and become successful: “Restore. Reclaim. Reward™.\r\n\r\nIf you’re interested in being a part of a company that cares, that is made up of people from all walks of life to empower each other and help build a strong business, come join us!','https://www.youtube.com/embed/Wkn3MiMrRfo',0,0,'2013-03-02 21:51:35','2014-10-30 08:26:59','Background.jpg','image/jpeg',1609353,'2014-08-08 21:50:13','Boresha_New_Logo_08082014.jpg','image/jpeg',24054,'2014-08-09 12:30:13',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<br>','',1,'Boresha – Creativity and Innovation for Health and Well-Being'),
	(9,4,NULL,'Welcome to O\'Hanlon of Abingdon','Digital Mobile Marketing Technology','The new way to help you sell your property','digital-mobile-marketing-abingdon','Mobi357 is the digital marketing company providing the next generation of mobile platform and services. Complete websites mobile ready and accessible across all platforms. Fully functional search engine capabilities tracking product and service views independently of each other, while generating identifiable leads to specific products and services',56,64,65,'','\r\nKenneth has been working on Mobile Marketing from 2003 being the first to bring to the market mobile marketing service, showing the service in Orlando National Association of Realtors in 2004 .Then in 2010 he received the Patent US 7,643,821.Also he received in 2013 Patent US 8,437,453.He now brings a new service in digital mobile marketing in HTML5 with the new mobi text & email service Now with Mobi357.co.uk','',0,0,'2013-03-02 21:51:35','2014-10-30 08:26:59','Mobile-Technology.jpg','image/jpeg',471578,'2013-04-11 17:19:51',NULL,NULL,NULL,NULL,'mobi_logo_(1).png','image/png',11117,'2013-06-22 11:44:38','mobi_logo.png','image/png',11117,'2013-06-22 11:42:06',NULL,NULL,1,NULL),
	(11,3,NULL,'Welcome To O\'Hanlon of Didcot','Digital Mobile Marketing','The New Way of selling your property','digital-mobile-marketing-didcot','',75,54,NULL,'','Kenneth has been working on Mobile Marketing from 2003 being the first to bring to the market mobile marketing service, showing the service in Orlando National Association of Realtors in 2004. Then in 2010 he received the Patent US 7,643,821. Also he received in 2013 Patent US 8,437,453. He now brings a new service in digital mobile marketing in HTML5 with the new text & email service mVerso.','',0,0,'2013-03-02 21:51:35','2014-10-30 08:26:59','didcot_012.jpg','image/jpeg',102522,'2013-08-07 15:05:18',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),
	(12,2,'wantage','Welcome To mVerso of Wantage','Mobile Marketing Automation','Any Device! Any time! Any where! ','digital-mobile-marketing-wantage','We sell Abingdon & Wantage & Didcot',59,NULL,NULL,'','Kenneth has been working on Mobile Marketing from 2003 being the first to bring to the market mobile marketing service, showing the service in Orlando National Association of Realtors in 2004. Then in 2010 he received the Patent US 7,643,821. Also he received in 2013 Patent US 8,437,453. He now brings a new service in digital mobile marketing in HTML5 with the new text & email service mVerso.','',0,0,'2013-03-02 21:51:35','2014-10-30 08:26:59','want5.jpg','image/jpeg',63312,'2013-08-07 15:02:14',NULL,NULL,NULL,NULL,'mobi_logo_(1)_(1).png','image/png',11117,'2014-03-19 18:40:20','mobi_logo_(1)_(1).png','image/png',11117,'2014-03-19 18:40:20',NULL,NULL,1,NULL),
	(15,13,'guitar','GTG Mobile Solutions','RE','We Drive Impulse!','gtg-mobile-solutions-llc','Real Time is Now the Norm',147,NULL,NULL,'GTG Mobile is the digital marketing company providing the next generation of mobile marketing platform and services.  Complete websites, mobile ready and accessible across all platforms.  Fully functional search engine capabilities, tracking product and service views independently of each other, while generating identifiable leads to specific products and services, capturing market share and driving sales.','The premier digital marketing organization on the planet.  \r\n\r\nFully stuffed, priced right, and prepared to deliver the finest marketing solutions in the industry.\r\n\r\nBar none.\r\n\r\nAny Screen, Any Where, Any Time!','',0,0,'2013-03-19 18:35:20','2014-10-30 08:26:59','56586899_-_Hands___Gears(edited)_-_Lightened.jpg','image/jpeg',57039,'2013-11-27 13:06:57','Temporary_Go_Text_Go_Logo_03192013.jpg','image/jpeg',19966,'2013-03-20 20:40:50',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),
	(18,16,'denver','Welcome','GTG Mobile Solutions','Denver','denver','',NULL,NULL,NULL,'GTG Mobile is the digital marketing company providing the next generation of mobile marketing platform and services.  Complete websites, mobile ready and accessible across all platforms.  Fully functional search engine capabilities, tracking product and service views independently of each other, while generating identifiable leads to specific products and services.  ','A digital marketing company providing the next generation of mobile marketing platform and services that are complete websites, mobile ready, and accessible across all platforms, with search engine capabilities, tracking product and service views independently of each other, while generating identifiable leads to those specific products and services.  \r\n\r\nThe platform is centrally managed and designed for deployment within an organization from a top down implementation.  It delivers day zero web responsiveness with SEO capability, optimizing web exposure and information delivery to any mobile device.\r\n\r\nWithin your branding and a couple of clicks, the GTG enterprise console deploys your marketing messaging across all users in compliance with your brand guidelines, while you build and deliver your marketing information and campaign schedule to all customers, consistently, across all mobile devices. \r\n','',0,0,'2013-03-20 20:53:52','2014-10-30 08:27:00','green-abstract-background.jpg','image/jpeg',549621,'2013-04-16 20:12:44',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),
