	(114,112,'crossfit','Service','Respect and Excellence','Curious about CrossFit? Interested in an introduction? Give us a call:   720.722.3805   e-mail: info@bighorncrossfit.com   ','juan-almonte','AFFORDABLE AND PAY AS YOU GO.\r\n\r\nPay as you go, campaign by campaign. Drive marketing and advertising efforts based on budgetary fluctuations and abilities.',194,195,196,'Progress and results every workout are what you will find at Big Horn CrossFit. We will NOT simply hand you a towel, tell you to look at the workout of the day (WOD) and say “good luck.” We will guide you through an appropriate warm-up, explain the WOD, demonstrate the movements, TEACH the movements, have you practice them, and then we will be there to see you SAFELY through to the end of the WOD!','Who We Work With\r\n- Motivated people who want to improve their quality of life\r\n\r\n- People with a high degree of personal accountability and drive\r\n\r\n- People who understand the value of knowledgeable professionals\r\n\r\n- People who need or want to improve their functional abilities\r\n\r\n- People who want to improve their health and/or feel better\r\n\r\n- People who want to reduce their health costs\r\n\r\n- People willing to invest in their health for the long term\r\n\r\n- People who expect a friendly, knowledgeable staff\r\n\r\n- People who want a place to feel comfortable in, whatever their current fitness level','//www.youtube.com/embed/MakX_XEN460',0,0,'2013-07-20 17:18:27','2014-10-30 08:27:03','th-3.jpeg','image/jpeg',16066,'2013-09-19 15:42:51',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),
