	(121,120,'citybike','Welcome','CityBike','The Bay Area\'s Motorcycle Publication','gtg-mobile',NULL,NULL,NULL,NULL,'CityBike was started in 1984 with the idea that the Bay Area motorcycle culture was vibrant, so ingrained in daily life, so rich in history, characters, stories, racing, riding, and comradeship that it deserved to be chronicled in print.\r\n\r\nOur mission remains the same: to deliver to you, our reader, thoughtful and provocative journalism that may lack for the gloss and polish of the major national magazines, but more than makes up with enthusiasm, participation, integrity, and loyalty to our readers and our beliefs. We\'re riders like you, and love riding, just like you.\r\n\r\nCityBike is Northern California\'s original free motorcycling publication. Since 1984, it\'s provided a special brand of motorcycle news, reviews and information to hundreds of thousands of readers. It\'s available at over 200 locations throughout Northern California or by subscription.','Citybike is the Premier Free Motorcycle Magazine Serving the Bay Area Since 1984.','https://www.youtube.com/embed/F1zrQvUAH1k',0,1,'2013-09-18 18:03:43','2014-10-30 08:27:03',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL),
