	(361,360,'torontoism','Welcome To','Long John Silver\'s','Torontoism Team','sotheby-s-international-realty',NULL,NULL,NULL,NULL,'We happily work with other agents in facilitating offers on your property to get you the best price possible in today\'s market.','I searched long and hard to find colleagues who loved the Real Estate Business as much as I do...and luckily I found three.\r\n\r\n\r\nThe four of us have very strong work ethics bordering on being A-type personalities. Each has their strengths and can assist the other to make sure that the Client, and not the agent, are always number one.\r\n\r\nTania and Richard organize and use their technology and marketing talents to make sure that the listing has the widest audience possible. Sherille and Kimberley are excellent at finding the right property for the new Buyer or the “Just Sold” Buyer looking to move up.\r\n\r\nAt the end of the day we are prepared to work hard making sure that your needs are met and that the result is more than you were hoping for. Nothing gives us more pleasure than your success and being with you through major life changes.\r\n\r\nOur goal is to have long-term clients and we hope that you will contact us.','https://www.youtube.com/embed/aXQfVn4prcc',0,0,'2014-03-28 20:13:08','2014-10-30 08:27:12','Toronto_Home_Sales.jpg','image/jpeg',257964,'2014-04-02 01:30:28','Torontoism_Logo.jpg','image/jpeg',13020,'2014-04-02 01:29:17','casey_house.jpg','image/jpeg',38046,'2014-04-02 01:24:41','casey_house.jpg','image/jpeg',38046,'2014-04-02 01:24:41','<br>','',1,''),
