	(440,441,'icix','Corporate Social Responsibility','Supply Chain & Regulatory Compliance','Product Safety','icix-north-america',NULL,NULL,NULL,NULL,'icix brings transparency, measurability, speed, simplification, and repeatability to a diverse set of global supply chains and their key stakeholders such as regulators, service providers, and customers. Each member of the icix relationship network benefits from faster transfer of mission critical information, more effective collaboration, and more structured communication.','','',0,0,'2014-09-01 09:46:19','2014-10-30 08:27:18','earth_home_banner2.jpg','image/jpeg',30432,'2014-09-02 10:41:53',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<br>','',1,'Industries'),
	(441,444,'superioragg','Superior Aggregates Inc','','','superior-aggregates-inc',NULL,NULL,NULL,NULL,'Trusting Us','     Family Owned and headquartered in Lafayette, Colorado, Superior Aggregates provides pavement maintenance and concrete services to the tri-county region including Boulder north to Longmont, East to Brighton, south to Thornton and north Denver, and back west towards Westminster and Arvada.\r\n\r\n     Having served our community for over 27 years, we offer free estimates, perform commercial and residential work, and can assist you with any of your pavement or concrete needs.  We also support those looking for assistance with their snow removal as well.\r\n\r\n     Give us a call. Trust our name.  And as part of our continued legacy, we will deliver great service and a quality product.','',1,0,'2014-09-25 18:47:17','2014-10-30 08:27:18','iStock_000026378231Large.jpg','image/jpeg',4827684,'2014-10-27 18:25:42','Superior_Agg_Logo_-_Wordpress_Adjusted_(640x328).jpg','image/jpeg',89061,'2014-09-26 20:05:45',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<br>','',0,'Why Superior Aggregates'),
