VALUES
	(1,47,'Mobile Commerce','The future is mobile…\r\n\r\nInternet savvy customers are now embracing mobile commerce (mCommerce). Smart phones (iPhone, Blackberry etc) are everywhere allowing people to connect to your brand on the move and make purchases.\r\n\r\nWith smaller screens and variable connection speeds it’s so important to get the user experience right. People want to buy after just a couple of clicks.\r\n\r\nWorking with Paypal and developed subscription services for smart phones, so your customers can access premium content or download the latest magazine direct to their phones.\r\n\r\nWe\'ve got the experience and technical know how to get you sorted. From mobile checkout and payment facilities, to social media marketing – we’ll make your future mobile.',NULL,'2013-05-20 19:39:25','2013-09-13 08:40:43'),
