	(8,5,'FACT #2','<p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; list-style-type: none; padding: 0px; text-align: justify;\"><font color=\"#7a7a7a\" face=\"Avant Garde, Avantgarde, Century Gothic, CenturyGothic, AppleGothic, sans-serif\" size=\"3\"><span style=\"line-height: 22.85714340209961px;\">The domestic health and wellness market eclipsed the $120 billion mark for 2012 and is projected to hit $170 billion in 2013.</span></font><br></p>',NULL,'2013-03-06 08:56:36','2014-08-09 12:49:51'),
