	(31,47,'Our Work','At mVerso we help you deliver the best content experience to your customers without sacrificing performance or quality.\r\nWe build technologies to help you cater for all contexts and channels your customers use, whether you\'re a large organization, a reseller, or a small business.  \r\nWe are pioneers in mobile web. Were active participants in formulating standards at W3C and IETF level. We provide the thought leadership, innovation, services and solutions to help you on every step of the journey to creating a web content strategy that is independent of device or platform constraints.\r\n',NULL,'2013-04-17 17:45:02','2014-10-13 09:18:41'),
	(32,47,'Mobile Web Technology','mVerso is an expert provider of mobile web technology, focused on helping you reach your customers, no matter the device, the content, or the context. We provide the solutions you need to ensure your content works in a dynamic, often uncertain web environment and have developed a range of patented products and tools to help our customers make their content work in a connected but diverse world. ',NULL,'2013-04-17 17:45:02','2014-10-13 09:18:41'),
	(33,47,'Responsive Web Design','The solution is responsive design.  One website, but with the content displayed in such a way that it stops the need for the gestures all together.  It doesn\'t matter if your visitor is on a tablet, desktop or mobile, the website textual and image content is displayed so that it can be read without the need to zoom.  In turn, the website can once again concentrate on ensuring that the visitor is happy that this is the website they were looking for, grabbing their attention once again.',NULL,'2013-04-17 17:45:02','2013-05-13 09:13:11'),
	(34,47,'Fastest Growing Marketing Platform Today','90% of text messages are opened within 10 minutes. 20% of consumers who receive a text message offer WILL make a purchase. In order to reach your customers how they want and when they want to be reached, you need a multi-channel marketing strategy that includes MOBILE. The mVerso platform offers just that - mobile marketing with SMS text message, photo and video marketing, text to screen, mobile coupons and mobile voting. Combine this with our email, broadcast,',NULL,'2013-04-17 17:45:02','2014-10-13 09:18:41'),
	(35,47,'Generate Leads and Connect with Today\'s Consumers','It\'s true that now over 75% of consumers will start their home buying search on the internet before they leave their house, look for a property professional or drive the neighborhoods they desire. All of this can be done anonymously without you even knowing they have an interest in your properties. The mVerso solution is a powerful marketing platform that delivers your property information - text descriptions, photos and videos - instantly to a consumer\'s mobile device. At the same time, it generates an instant lead for your Realtor in a text message and email capturing the consumer\'s cell phone number. That\'s superior content delivery for consumers and instant lead generation for your Agency.',NULL,'2013-04-17 17:45:02','2014-10-13 09:18:41'),
	(36,47,'Leverage Your Vendor Relationships','Generate and Capture Leads for You and Your Co-Marketing Partner. You choose the Cities and Post Codes to deliver your message to. mVerso unique Co-Marketing platform enables the delivery of Text, Photo and Video information from more than one company at the SAME time. You and your vendors can leverage your marketing spend by teaming up to create mobile marketing campaigns that will generate leads for both of you. mVerso Co-Marketing platform enables companies to select the cities and Post Codes they want to deliver their mobile marketing message to, along with our Realtor\'s partners, when consumers call the  For Sale or To Let sign. Each Co-Marketing partner will have a mVerso-Brochure of their own delivered along with the real estate information',NULL,'2013-04-17 17:45:02','2014-10-13 09:18:41'),
	(37,49,'Text Message or Mobile Marketing is the FASTEST growing marketing platform today','90% of text messages are opened within 10 minutes. \r\n20% of consumers who receive a text message offer WILL make a purchase.\r\nIn order to reach your customers how they want and when they want to be reached, you need a multi-channel marketing strategy that includes MOBILE.\r\nThe Mobi357 platform offers just that - mobile marketing with SMS text message, photo and video marketing, text to screen, mobile coupons and mobile voting. Combine this with our email, voice broadcast,\r\n',NULL,'2013-04-18 22:17:37','2013-04-19 11:51:43'),
	(38,49,'Do you have the tools you need to generate leads and connect with today\'s consumers?','It\'s true that now over 75% of consumers will start their home buying search on the internet before they leave their house, look for a property professional or drive the neighborhoods they desire. All of this can be done anonymously without you even knowing they have an interest in your properties. \r\nThe mVerso solution is a powerful marketing platform that delivers your property information - text descriptions, photos and videos - instantly to a consumer\'s mobile device. At the same time, it generates an instant lead for your Estate Agent in a text message and email capturing the consumer\'s cell phone number. That\'s superior content delivery for consumers and instant lead generation for your Agency. \r\n',NULL,'2013-04-18 22:17:37','2013-04-19 11:51:43'),
	(39,49,' Leverage your Vendor Relationships - Send YOUR message and THEIRS together.','Generate and Capture Leads for You and Your Co-Marketing Partner.\r\nYou choose the Cities and Post Codes to deliver your message to.\r\nMobi357\'s unique Co-Marketing platform enables the delivery of Text, Photo and Video information from more than one company at the SAME time. You and your vendors can leverage your marketing spend by teaming up to create mobile marketing campaigns that will generate leads for both of you.\r\n\r\nMobi357\'s Co-Marketing platform enables companies to select the Cites and Post Codes they want to deliver their mobile marketing message to, along with our Estate Agent partners, when consumers call the Estate Agent For Sale or To Let sign. Each Co-Marketing partner will have a MobiBrochure of their own delivered along with the real estate information.\r\n',NULL,'2013-04-18 22:17:37','2013-04-19 11:51:43'),
