	(136,47,'Unified Communications Certificate','Unified communications (UC) certificates (also called SAN certificates) use Subject Alternative Names to secure up to 4 domains, sites, and subdomains with one certificate. For example, with a UC certificate you can secure www.example.com, www.example2.com, www.example3.net, mail.example.net, dev.example2.com, etc. This makes UC certificates perfect for Exchange/OCS environments or any environment where you need to secure multiple names across different domains.',NULL,'2013-12-14 18:03:28','2013-12-14 18:03:28'),
	(137,47,'Real-time lead data on every campaign','marketing automation solutions have web based\r\nreporting tools that let you see phone lead data in\r\nreal time. You can con!gure the data any way you want to\r\ncreate meaningful reports on which campaigns are driving\r\nphone leads.\r\n',NULL,'2013-12-14 18:03:28','2014-01-08 09:00:20'),
	(158,146,'','',NULL,'2014-01-29 17:18:10','2014-01-29 17:18:10'),
	(164,361,'Serving Food at Our Expense','We are known for providing Agent Open Houses with food served at our expense. It encourages the Realtors to spend more time, look around, feel comfortable and engage with each other. ',NULL,'2014-04-02 00:33:33','2014-04-02 01:19:18'),
	(165,361,'Social Media Broadcast','Announcements of new listing and their Open Houses are broadcast on Twitter, Facebook, LinkedIn and more.',NULL,'2014-04-02 01:19:18','2014-04-02 01:19:18'),
	(166,361,'Neighbour Marketing','We have often been surprised at the power of \"neighbour marketing\" so we send out Just Listed and Open House invitation cards to the surrounding 2000 homes at our expense.',NULL,'2014-04-02 01:19:18','2014-04-02 01:19:18'),
	(167,361,'Proper, Property Placement','We long ago realized the importance of the Internet so not only are properties placed on the TorontoMLS system, they are on REALTOR.ca , shared on the Toronto Real Estate Board\'s Internet Data Exchange or IDX, they also appear on http://www.torontoism.com/, and http://www.downtowntorontonews.com/ as well as our Company site http://sothebysrealty.ca/en. ',NULL,'2014-04-02 01:19:18','2014-04-02 01:19:18'),
	(168,361,'Professionally Optimized','All these sites are optimized professionally to be on the front pages of the Search Engines in the top 30 Categories of search terms for Toronto Real Estate.',NULL,'2014-04-02 01:19:18','2014-04-02 01:19:18'),
	(169,361,'Open Every Possible Weekend','Recognizing that Today\'s Buyers have changed the way they shop, we suggest Open Houses for the Public on every possible weekend.',NULL,'2014-04-02 01:19:18','2014-04-02 01:19:18'),
	(171,121,'CLASSIFIEDS','Advertise Your Motorcycle or Business Here and in the Print Magazine. Deadline is the 15th of Each Month.',NULL,'2014-04-13 13:00:14','2014-05-10 12:14:50'),
	(172,121,'EVENTS','CITYBIKE EVENTS - GET THE LATEST INFO HERE !',NULL,'2014-04-13 13:00:14','2014-05-10 12:27:40'),
	(173,92,'','',NULL,'2014-04-17 01:57:42','2014-04-17 01:57:42'),
	(174,121,'ROADS & RENTALS','Your Rental Resource Serving All of San Francisco.',NULL,'2014-05-10 12:27:40','2014-05-10 12:27:40'),
	(175,5,'FACT #3','<div><span style=\"color: rgb(122, 122, 122); font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; font-size: 16px; line-height: 24px; text-align: center;\">Cooperative Marketing is over a $110 billion industry and is a distribution method used by some of the most successful organizations in the world.</span></div>',NULL,'2014-08-09 12:49:51','2014-08-09 12:51:42'),
	(177,440,'Retail','Retailers face an ever-increasing challenge to meet regulatory \r\ncompliance requirements and ensure product quality and safety. New \r\nrequirements demand the capture of much more granular data in all the \r\nmarkets where they do business. Retailers must also have visibility \r\nacross multiple tiers in the supply chain – at the same time that supply\r\n chains have become more global and more complex. That’s why a number of\r\n leading retailers—including Toys R Us, Walmart, and Whole Foods—were \r\namong the first companies to join the icix network and cloud \r\napplications.',NULL,'2014-09-02 08:37:13','2014-09-04 10:13:26'),
	(178,440,'Food & Beverage','Maintaining a&nbsp;safe food supply&nbsp;requires the consistent and reliable \r\nperformance of many inter-dependent components of the supply chain. \r\nRegulatory bodies must have access to appropriate resources, while \r\nmanufacturers and suppliers must follow ethical business practices and \r\nstrictly adhere to legislative requirements such as the&nbsp;<a title=\" Food Safety Modernization Act\" class=\"tippy_link\" id=\"tippy_1_link\"> Food Safety Modernization Act</a>&nbsp;and independent quality standards such as the <a title=\" Global Food Safety Initiative\" class=\"tippy_link\" id=\"tippy_2_link\"> Global Food Safety Initiative</a>, which have been adopted by many of the world’s largest retailers.',NULL,'2014-09-02 10:41:53','2014-09-04 10:13:26'),
	(179,440,'Consumer Packaged Goods','Rapidly evolving customer preferences and fierce competition are driving\r\n Consumer Packaged Goods (CPG) companies to increase their brand \r\nportfolios and expand operations to new geographies. As CPG supply \r\nchains become more complex, global, and fluid, the challenges of \r\nmanaging trading partner relationships, sharing mission-critical \r\ninformation, and measuring trading partner performance have made \r\ntransparency and predictability more difficult to achieve.&nbsp;Brand \r\nintegrity is key to staying ahead of competition in CPG and one misstep \r\ncould damage your image and overall market growth potential.',NULL,'2014-09-04 10:13:26','2014-09-04 10:13:26'),
	(180,441,'','<p class=\"justify list-cross\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: \'trebuchet ms\', geneva; font-size: small; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: bold; line-height: inherit; vertical-align: baseline;\">Family Owned</span>&nbsp;and headquartered in Lafayette, Colorado, Superior provides pavement maintenance and concrete services to the tri-county region including Boulder north to Longmont, East to Brighton, south to Thornton and north Denver, and back west towards Westminster and Arvada.</span></p><p class=\"list-cross\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: \'trebuchet ms\', geneva; font-size: small; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;\">&nbsp; &nbsp; &nbsp;Having served our community for over 27 years, we offer free estimates, perform commercial and residential work, and can assist you with any of your pavement or concrete needs.</span></p>',NULL,'2014-09-26 20:27:29','2014-09-26 20:32:18');
