	(4,'Lean Infrared Roasted Coffee',26,'2012-11-19 22:15:07','2014-08-11 22:06:07',NULL,'USD','','<div><font face=\"helvetica\" size=\"4\">Yes, it really is as good as it sounds. Better actually, because it is good for you,too. You get the full-bodied flavor of infrared-roasted, fresh-brewed coffee packed with powerful weight-control ingredients. A catalyst product within the 7-to-7</font><font face=\"helvetica\" size=\"1\">TM</font><font face=\"helvetica\" size=\"4\"> Nutrition and Lifestyle Guide, Boresha Lean coffee is the only patent-pending slimming coffee containing Slendrinol</font><font face=\"helvetica\" size=\"1\">TM</font><font face=\"helvetica\" size=\"4\">, a proprietary blend of patented and patent-pending active ingredients.</font></div><div><br></div>','','',NULL,1924,NULL),
	(7,'Slim Mango Peach Tea Mix',29,'2012-11-19 22:27:20','2014-08-11 22:06:29',NULL,'USD','','<span style=\"color: rgb(122, 122, 122); font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; font-size: 16px; line-height: 24px;\">Imagine sun-ripened mangos and peaches bursting with juice, mixed with the unmistakable mouth-feel of green tea. Boresha Slim is a delectable, instant tea beverage within the 7-to-7™ product family. It is a great tasting, refreshing mango-peach-flavored tea mix you can enjoy while on the go.</span>','','',NULL,1925,NULL),
	(19,'Property',44,'2013-03-05 10:14:36','2014-05-05 02:52:41',NULL,NULL,NULL,'Tudor Cottage is a delightful and substantial 17th Century Grade ll listed cottage, situated in the heart of one of the area\'s most sought after villages, offering a wealth of character features including heavily beamed walls/ceilings and inglenook fireplaces, complemented by extensive and very private rear gardens leading directly onto stunning open countryside, with a garage approached from the rear.','','',NULL,1749,NULL),
	(20,'Automotive',45,'2013-03-05 10:14:36','2014-09-15 20:03:27',NULL,'USD','','mVerso/Auto ','<iframe width=\"560\" height=\"315\" src=\"//www.youtube.com/embed/iuuE2XeUiNc\" frameborder=\"0\" allowfullscreen></iframe>','',NULL,2111,NULL),
