	(31,'Web Services',112,'2013-04-17 17:48:20','2014-05-05 02:56:54',NULL,NULL,NULL,'The solution is responsive design. One website, but with the content displayed in such a way that it stops the need for the gestures all together. It doesn\'t matter if your visitor is on a tablet, desktop or mobile, the website textual and image content is displayed so that it can be read without the need to zoom.  In turn, the website can once again concentrate on ensuring that the visitor is happy that this is the website they were looking for, grabbing their attention once again.','','',NULL,1782,NULL),
