	(130,'Unified communications (UC) certificates',243,'2014-01-07 15:05:37','2014-05-05 03:04:01',NULL,'USD','','<b>Unified communications (UC) certificates </b>(also called SAN certificates) use Subject Alternative Names to secure up to 4 domains, sites, and subdomains with one certificate. For example, with a UC certificate you can secure www.example.com, www.example2.com, www.example3.net, mail.example.net, dev.example2.com, etc. This makes UC certificates perfect for Exchange/OCS environments or any environment where you need to secure multiple names across different domains.<br>','','',NULL,1815,NULL),
