	(159,'Grangemouth Scottish Ale',302,'2014-05-12 15:10:21','2014-05-12 15:20:03',NULL,'USD','','<h5 style=\"margin-bottom: 0.0001pt; line-height: 15pt; background-position: initial initial; background-repeat: initial initial;\"><font size=\"5\" face=\"georgia\"><span style=\"color: rgb(153, 0, 0);\">Soon to be one of your favorite beers. &nbsp;<br></span></font><span style=\"color: rgb(47, 53, 62);\"><o:p><font size=\"5\" face=\"georgia\">&nbsp;<br></font></o:p></span><span style=\"color: rgb(153, 0, 0);\"><font size=\"5\" face=\"georgia\">Pours a clear coppery color just enough solid, a slightly\r\noff-color head and a very nice aroma. &nbsp;You will find some malts and a\r\nfruity smell easily picked up by the nose.<br></font></span><span style=\"color: rgb(153, 0, 0);\"><o:p><font size=\"5\" face=\"georgia\">&nbsp;<br></font></o:p></span><font size=\"5\" face=\"georgia\"><span style=\"color: rgb(153, 0, 0);\">The taste is likewise, amazing. Starts sweet\r\nand is followed by nice biscuity body, slight bitterness towards the end, and\r\nfinishes with a nice spicy finish. &nbsp;Easily drinkable, smooth,\r\ndelicious.&nbsp;<br></span></font><span style=\"color: rgb(47, 53, 62);\"><o:p><font size=\"5\" face=\"georgia\">&nbsp;<br></font></o:p></span><span style=\"color: rgb(153, 0, 0);\"><font size=\"5\" face=\"georgia\">No doubt, you will agree it is just great!</font></span></h5>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n','<iframe width=\"560\" height=\"315\" src=\"//www.youtube.com/embed/izWcuN\" frameborder=\"0\" allowfullscreen></iframe>','',NULL,1848,NULL),
