	(161,'Fit Lemonade',305,'2014-08-11 21:49:17','2014-08-11 22:06:54',NULL,'USD','','<p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">It starts with the crisp, unmistakable tartness of freshly squeezed lemon and follows up with a sweet splash of goodness. Boresha Fit with Acai Berry Powder is a great tasting, rejuvenating lemonade-flavored beverage with an amazing triple-action formula.</p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">Boresha Fit contains&nbsp;Renovigin™, a proprietary science-based blend containing patent-pending ingredients, including&nbsp;L-Arginine base form, branch-chained amino acids, chlorogenic acid and a patent pending, more effective form of soluble&nbsp;chromium.</p>','','',NULL,1926,NULL),
	(162,'Sweet Sutalin Natural Sweetner',306,'2014-08-11 21:56:01','2014-08-11 22:05:06',NULL,'USD','','<p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">People are increasingly concerned about metabolic health and are looking for sweeteners that are natural and don’t spike blood sugar levels.</p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">7-to-7™ Boresha Sweet with Sutalin™ is a low-glycemic sweetener that is the perfect complement to Boresha Lean or Boresha Slim. Sutalin™ is a unique blend that can be used with coffee or tea, or it can be enjoyed wherever regular sugar or sweetener are used. It provides the body with a steady, low-glycemic energy source without excess carbohydrates.</p>','','',NULL,1923,NULL),
	(163,'Arctic cat recalls side by sides due to fire Hazard (Recall Alert)',316,'2014-09-17 12:14:34','2014-09-17 12:48:40',NULL,'USD','Recall number 14-753','<h3 style=\"color: rgb(51, 51, 51); margin-top: 0px; margin-bottom: 5px; padding: 0px; border: 0px; outline: 0px; font-size: 17px; vertical-align: baseline; font-family: Cabin, arial, serif, sans-serif; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><br></h3><p style=\"color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; font-family: Cabin, arial, serif, sans-serif; outline: 0px !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><br></p><h3 style=\"color: rgb(51, 51, 51); margin-top: 0px; margin-bottom: 5px; padding: 0px; border: 0px; outline: 0px; font-size: 17px; vertical-align: baseline; font-family: Cabin, arial, serif, sans-serif; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp; Recall Summary</h3><p style=\"color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; font-family: Cabin, arial, serif, sans-serif; outline: 0px !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span class=\"lbl\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-weight: bold; line-height: normal; position: relative; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Name of product:</span><span style=\"line-height: normal;\"></span></p><p style=\"color: rgb(51, 51, 51); margin-top: 10px; margin-bottom: 17px; margin-left: 10px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; font-family: Cabin, arial, serif, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><b><u>Arctic Cat Wildcat Trail and Wildcat Trail XT Side by Side</u></b></p><p style=\"color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; font-family: Cabin, arial, serif, sans-serif; outline: 0px !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span class=\"lbl\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-weight: bold; line-height: normal; position: relative; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Hazard:</span><span style=\"line-height: normal;\"></span></p><div style=\"color: rgb(51, 51, 51); margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-family: Cabin, arial, serif, sans-serif; line-height: normal; position: relative; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><p style=\"font-size: 13px; color: rgb(51, 51, 51); margin-top: 10px; margin-bottom: 17px; margin-left: 10px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 18px; background-image: initial; background-attachment: initial; background-color: transparent; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Oil can leak from the oil cooler lines, posing a fire hazard.</p><h5 style=\"color: rgb(51, 51, 51); margin-top: 20px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-family: Cabin, arial, serif, sans-serif; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"font-size: 13px;\">&nbsp; &nbsp;</span><font size=\"2\"><b>Incidents/Injuries</b></font></h5><p style=\"font-size: 13px; color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 18px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Arctic Cat has received 60 reports of oil leaking and one report of fire. No injuries have been reported.</p><h5 id=\"remedy\" style=\"color: rgb(51, 51, 51); margin-top: 20px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-family: Cabin, arial, serif, sans-serif; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"font-size: 13px;\">&nbsp; &nbsp;</span><font size=\"2\"> <b>Remedy</b></font></h5><p style=\"font-size: 13px; color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 18px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Consumers should stop using the recalled side-by-side utility vehicles immediately and contact an Arctic Cat dealer to schedule a free repair.</p><p style=\"font-size: 13px; color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 18px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><br></p><h3 style=\"font-family: Cabin, arial, serif, sans-serif; line-height: normal; color: rgb(51, 51, 51); margin-top: 0px; margin-bottom: 5px; font-size: 17px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp; &nbsp;Recall Details</h3><h5 style=\"font-family: Cabin, arial, serif, sans-serif; line-height: normal; color: rgb(51, 51, 51); margin-top: 20px; margin-right: 0px; margin-left: 0px; font-size: 13px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp; &nbsp; &nbsp;Units&nbsp;<span style=\"color: rgb(0, 0, 0); line-height: 18px;\">About 5,600</span></h5><h5 style=\"font-family: Cabin, arial, serif, sans-serif; line-height: normal; color: rgb(51, 51, 51); margin-top: 20px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><font size=\"2\"><b>&nbsp; &nbsp; &nbsp;Description</b></font></h5><p style=\"margin-bottom: 0px; margin-left: 20px; color: rgb(51, 51, 51); padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; outline: 0px !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">This recall involves all 2014 Arctic Cat Wildcat Trail and Wildcat Trail XT side-by-side utility vehicles with Vehicle Identification Numbers (VIN) 000001 through 316232. The VIN is located on the frame tube near the driver’s side front wheel. These units were sold in red, green, lime green, team arctic green and mat black. The words “Arctic Cat” and “Wildcat Trail” appear on the sides of these vehicles and on the hood.</p><h5 style=\"font-size: 13px; color: rgb(51, 51, 51); margin-top: 20px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-family: Cabin, arial, serif, sans-serif; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp; &nbsp; <b><u>&nbsp;Sold exclusively at</u></b></h5><p style=\"font-size: 13px; color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 18px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><b><u>Arctic Cat dealers nationwide from December 2013 through July 2014 for about $11,400 to $12,400.</u></b></p><h5 style=\"color: rgb(51, 51, 51); margin-top: 20px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-family: Cabin, arial, serif, sans-serif; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"font-size: 13px;\">&nbsp; &nbsp; &nbsp;</span><font size=\"2\"><b>Manufacturer</b></font></h5><p style=\"font-size: 13px; color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 18px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Arctic Cat, Inc., of Thief River Falls, Minn.</p><h5 style=\"font-size: 13px; color: rgb(51, 51, 51); margin-top: 20px; margin-right: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-family: Cabin, arial, serif, sans-serif; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&nbsp; &nbsp; &nbsp;Manufactured in&nbsp;<span style=\"color: rgb(0, 0, 0); line-height: 18px;\">United States</span></h5></div><p style=\"color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; font-family: Cabin, arial, serif, sans-serif; outline: 0px !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"font-weight: bold; line-height: normal; color: rgb(0, 0, 0);\"><br></span></p><p style=\"color: rgb(51, 51, 51); margin-bottom: 0px; margin-left: 20px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; font-family: Cabin, arial, serif, sans-serif; outline: 0px !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"font-weight: bold; line-height: normal; color: rgb(0, 0, 0);\">Consumer Contact:</span><br></p><p style=\"color: rgb(51, 51, 51); margin-top: 10px; margin-bottom: 17px; margin-left: 10px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; font-family: Cabin, arial, serif, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></p><p style=\"color: rgb(51, 51, 51); margin-top: 10px; margin-bottom: 17px; margin-left: 10px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; line-height: 18px; font-family: Cabin, arial, serif, sans-serif; outline: 0px !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Arctic Cat at (800) 279-6851 from 8 a.m. to 5 p.m. CT Monday through Friday or online at&nbsp;<a href=\"http://www.articcatland.com/\" style=\"color: rgb(59, 96, 175); margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline;\" title=\"\" target=\"\">www.articcat</a>.com click on Consumer Care, then Product Recall and then List of Safety Bulletins for more information.</p>','<iframe width=\"560\" height=\"315\" src=\"//www.youtube.com/embed/0EczhJpwVe8\" frameborder=\"0\" allowfullscreen></iframe>','',NULL,2112,NULL),
	(164,'Snow Removal',317,'2014-09-27 12:02:18','2014-09-27 12:43:39',NULL,'USD','','<div><h5 style=\"margin-bottom: 15pt; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"font-size: 24pt;\"><font face=\"georgia\">Superior Snow and Ice Removal</font></span></h5>\r\n\r\n<p style=\"margin: 0in 0in 0.0001pt; line-height: 18pt; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><font size=\"3\"><font face=\"trebuchet ms\">As your year round concrete and asphalt maintenance resource,&nbsp;</font><span style=\"font-family: \'trebuchet ms\';\">Superior Aggregates is </span><span style=\"font-family: \'trebuchet ms\'; line-height: 18pt;\">available for your snow plowing and ice removal demands during the\r\nwinter months. </span><span style=\"font-family: \'trebuchet ms\'; line-height: 18pt;\">&nbsp;</span><span style=\"font-family: \'trebuchet ms\'; line-height: 18pt;\">Not having a snow removal\r\nservice is a liability: For residents, employees, or customers, you need to provide\r\nthem with clear, safe passages.</span></font></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:15.75pt;background:\r\n#FDFDFD\"><o:p><font size=\"3\" face=\"trebuchet ms\">&nbsp;</font></o:p></p><p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;line-height:15.75pt;background:\r\n#FDFDFD\"><font size=\"3\"><span style=\"font-family: \'trebuchet ms\'; line-height: 18pt; background-color: rgb(255, 255, 255);\">We specialize in snow removal for strip malls,\r\nstores, restaurants, office buildings, apartment buildings, and HOA’s.&nbsp;</span><span style=\"font-family: \'trebuchet ms\'; line-height: 18pt; background-