ggregates is there for\r\nyou, your residents, your employees, and your customers.&nbsp; Give us a call today!</font><o:p></o:p></font></p></div><div><br></div><div><br></div>','','',NULL,2127,NULL),
	(165,'Crackseal',318,'2014-09-30 11:47:03','2014-09-30 12:21:28',NULL,'USD','','<span style=\"margin: 0px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 20px; font-weight: bold; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\">Sealing cracks</span><span style=\"color: rgb(51, 51, 51); font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px;\">&nbsp;is the most economical way to prevent future asphalt deterioration and asphalt expenses. Small cracks of ¼ inch or less can be effectively sealed using a hot and pourable crack sealant.&nbsp;</span><div><span style=\"color: rgb(51, 51, 51); font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px;\"><br></span></div><div><span style=\"color: rgb(51, 51, 51); font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px;\">Cracks can be blown out or routed and filled with this material. The result is a crack that is impervious to the water that could easily deteriorate the sub-base of the pavement and compromise its integrity if it is allowed to freely flow downward.</span><br></div>','','',NULL,2132,NULL),
	(166,'Asphalt Paving',320,'2014-10-01 22:59:45','2014-10-02 02:13:57',NULL,'USD','','<p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: 20px; font-style: inherit; font-variant: inherit; font-weight: bold; line-height: inherit; vertical-align: baseline;\">Over 25 years ago</span>, Superior Aggregates began patching commercial asphalt parking lots. &nbsp;The technology was simple , a rented cutoff saw, a rented jackhammer, a rented skid-steer, a dump truck with a layton box tied to tail gate and 2 people ready to shovel and rake. &nbsp;Off we went.</p><p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\">T</span>oday, whether you know it as blacktop, pavement, or even asphalt, we continually serve hundreds of businesses and municipalities across thirty neighboring municipalities and 5 counties.&nbsp;Superior Aggregates works directly with property and business owners identifying yearly facility management asphalt repair programs as well as assisting those in need of immediate expertise and road &nbsp;repair, parking lot maintenance, or a new installation.</p><p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\"><span id=\"more-270\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;\"></span>W</span>e believe in delivering quality work at reasonable prices. &nbsp;To date, Superior Aggregates has provided thousands of new asphalt paving installations to contractors, municipalities, and business owners. &nbsp;We approach every installation in the same manner with special attention to&nbsp;subgrade, compaction, as well as the asphalt drainage. &nbsp;Superior Aggregates works with any grade of asphalt mix from Sx to S to Superpave. We own our own equipment and provide the very best in safety and operations.</p>','','',NULL,2157,NULL),
	(167,'Concrete Paving',321,'2014-10-05 12:12:16','2014-10-05 13:26:19',NULL,'USD','','<header class=\"entry-header\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 13px; line-height: 21.0599994659424px; vertical-align: baseline; float: none; width: auto; color: rgb(51, 51, 51);\"><p style=\"margin-top: 0px; margin-bottom: 24px; padding: 0px; border: 0px; font-family: Oswald, sans-serif; font-style: inherit; font-variant: inherit; line-height: 1.62em; vertical-align: baseline; letter-spacing: 1px; overflow: hidden;\"><span style=\"color: rgb(0, 0, 0); font-family: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 20px; font-weight: bold; vertical-align: baseline;\"><span style=\"font-size: 15px; line-height: 24.2999992370605px; font-family: \'Open Sans\', sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A</span></span><span style=\"font-size: 15px; line-height: 24.2999992370605px; font-family: \'Open Sans\', sans-serif;\">s a f</span><span style=\"font-style: inherit; font-variant: inherit; font-family: \'Open Sans\', sans-serif; font-size: 15px; letter-spacing: normal; line-height: 24.2999992370605px;\">ull service pavement maintenance company, we specialize in concrete removal and replacement for driveways, sidewalks, curb and gutter, access aprons, and drain channels for both residential and commercial clients. Superior Aggregates has the ability to produce stamped and exposed concrete products as well.</span></p><div class=\"entry-content\" style=\"margin: 0px; padding: 0px; border: 0px; font-size: 15px; line-height: 1.62em; vertical-align: baseline;\"><p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A</span>s a concrete contractor, 0ur work is about quality at a fair price. We always provide the customer with the option of utilizing rebar and curing products to add additional strength to the concrete product and to assist in the curing process, reducing the tendency for cracking.</p><p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; W</span>e utilize Colorado Department of Transportation specified concrete mix in all of our applications from sidewalks to commercial loading docks. If you need to open the new concrete to truck traffic within 24 hours, we have the option of using High Early strengthened concrete that sets and hardens very quickly.</p><p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; W</span>e pay close attention to safety and debris. Our crews immediately haul away broken up concrete to recycling facilities as stock piled concrete is both a hazard and an eyesore for yourself and others.&nbsp; We always barricade the worksite thoroughly to protect you and those residences or commercial tenants around you.</p></div></header>','','',NULL,2167,NULL),
	(168,'Sealcoat',322,'2014-10-06 11:44:01','2014-10-06 12:02:07',NULL,'USD','','<p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: 20px; font-style: inherit; font-variant: inherit; font-weight: bold; line-height: inherit; vertical-align: baseline;\">By protecting your investment</span>&nbsp;with sealcoat, your asphalt surface will create appeal to your customers and increase the value of your home or commercial property.&nbsp; Superior Aggregates provides seal coating services to both residential and commercial property.</p><p style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\">S</span>ealcoating seals the surface of an asphalt mat, preventing moisture intrusion while recoating the top layers of aggregate with asphalt and replacing the oils that have been lost through oxidation.&nbsp; Sealcoating can extend the life of your asphalt pavement, potentially reducing the need for costly periodic repairs.</p><p style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\">O</span>ur lead project managers evaluate every site personally to give you the very best estimate of what is needed. We work within your budget, managing expectations and technical requirements plus offering points to consider before starting any sealcoating project. We are the proven leaders in sealcoating, our priority is to satisfy you and your expectations, and we use the best equipment and material available.</p><p style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit; vertical-align: baseline;\">Y</span></span>ou will receive the&nbsp;absolute&nbsp;best service from our employees and we tend to look at every project as if it were our own property. Whether it is a large project like a parking lot or a small driveway of the house, our dedication and efforts will be similar.</p>','','',NULL,2168,NULL),
