	(6,2,'Kenneth O\'Hanlon Managing Director','Kenneth has been working on Mobile Marketing from 2003 being the first to bring to the market mobile marketing service, showing the service in Orlando National Association of Realtors in 2004 .Then in 2010 he received the Patent US 7,643,821. Also he received in 2013 Patent US 8,437,453.He now brings a new service in digital mobile marketing in HTML5 with the new mobi text &amp; email service   O\'Hanlon has been one of  leading independent Mobile text marking  for over 10 years as the Managing Director  offers a wealth of experience in helping  agents market and successfully selling property in Denver and the USA, which has led to O\'Hanlon continually being the market leader within Digital Mobile Marketing.  \r\n\r\nO\'Hanlon and his team guarantee a high quality selling service combining modern techniques with traditional values, helping people move as smoothly as possible in a business that is often very stressful.\r\n','2013-03-03 06:22:15','2014-09-11 11:26:05','20130331_114013.jpg','image/jpeg',65451,'2013-04-19 17:27:44'),
	(11,5,'George Najjar','<p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><em style=\"margin-bottom: 0px; outline: none !important;\">Founder, President and CEO of Boresha International, Inc.</em></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">Identifying a strong opportunity in the automotive industry over 16 years ago, George first began his career as a salesman at a Ford Motor Company dealership, and went on to quickly breaking company sales records.&nbsp;</p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><br></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">Soon thereafter he joined BMW, where he soon became one of the top 10 salespeople in the nation. George was promoted to Sales and Finance Director where he tripled sales volume, and became one of the top Directors in the US.&nbsp;</p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><br></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">George has also gained Network Marketing Experience as an Independent Distributor since 1991.</p>','2013-03-06 08:56:36','2014-08-09 12:18:50','employee1.jpg','image/jpeg',41117,'2013-03-06 09:30:16'),
	(13,5,'Len Di Giovanni','<p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><em style=\"margin-bottom: 0px; outline: none !important;\">Co-Founder and VP of Business Development</em></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">Len brings 30 years of success directing multi-faceted business units, with a unique blend of skills and a proven record of helping his clients achieve results.&nbsp;</p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><br></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">A results-driven leader, Len is passionate about “creating an organization and environment that allows people to succeed and grow with the end result being profit and intrapersonal improvement.&nbsp;</p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><br></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">Len’s successful approach to business stems from his experience in various executive and Board of Directors leadership positions, where he has created corporate teams, customer service support, developed sales plans and marketing strategies, and headed new business and product development programs as Founder &amp; President, Twelve Bridges Management Group.</p>','2013-03-06 08:56:36','2014-08-09 12:18:50','employee3.jpg','image/jpeg',37674,'2013-03-06 09:30:18'),
