	(196,114,'Brian Bowen – Co-Owner / Head Coach','I have been involved in sports and athletics nearly all of my life. The joy of running, jumping, lifting, climbing, and pushing my body to its physical limit has always been a big part of who I am. CrossFit found me in 2006, while I was still in the active duty Air Force–I became addicted immediately! The methodology of training was relatively new to that branch of the service, so I decided to introduce it to as many people as I could.\r\n','2013-08-20 03:22:43','2013-09-19 15:25:23','family.jpg','image/jpeg',65938,'2013-09-19 15:25:22'),
	(198,117,'Kenneth O\'Hanlon Managing Director','Kenneth has been working on Mobile Marketing from 2003 being the first to bring to the market mobile marketing service, showing the service in Orlando National Association of Realtors in 2004 .Then in 2010 he received the <b><u>Patent US 7,643,821</u></b>. Plus &nbsp;2013<b><u> Patent US 8,437,453</u></b>. Then in 2014 <b><u>Patent US&nbsp;</u></b><span style=\"color: rgb(67, 70, 73); font-family: Arial, sans-serif; line-height: 16px;\"><b><u>8,774,371</u></b>&nbsp;</span>.Also he received in 2014 <b><u>PatentUS&nbsp;</u></b><span style=\"color: rgb(67, 70, 73); font-family: Arial, sans-serif; line-height: 16px;\"><b><u>8,817,959</u></b>.</span><br>&nbsp;He now brings a new service in digital mobile marketing in HTML5 with the new mobi text &amp; email service   O\'Hanlon has been one of leading independent Mobile text marketing for over 10 years as the Managing Director offers a wealth of experience in helping agents market and successfully selling property in Denver and the USA, which has led to O\'Hanlon continually being the market leader within Digital Mobile Marketing Automation.','2013-08-26 15:54:51','2014-11-12 20:43:34','20130331_114013.jpg','image/jpeg',65451,'2014-02-28 10:47:46'),
	(204,114,'Kari Bowen – Co-Owner / Coach  ','I am a mother, a wife, a meteorologist, an Air Force veteran, and yes…I am a CrossFitter. I found CrossFit in 2007, and I also found my husband. I do not believe that it was a coincidence that I found both at the same time. I have always found joy in helping others, and watching them reach their true potential–CrossFit has elevated this passion to another level. I earned my certification in 2009 and like my husband, I wanted more than just a certification.','2013-09-19 15:26:22','2013-09-19 15:26:22','kari_B_swing.jpg','image/jpeg',127455,'2013-09-19 15:26:20'),
