	(215,50,'Mariela Mea','With more than 28 years of experience in her field, Ms. Mea has positioned herself with great success in the areas of sales, marketing, corporate image, training and curriculum development. ','2013-11-30 13:28:41','2013-11-30 13:28:41','Mariela_Head_Shot.jpg','image/jpeg',12434,'2013-11-30 13:28:40'),
	(216,50,'Scott McDonough','Scott McDonough is a serial entrepreneur devoting his time to industry professionals, supporting and building business opportunities across various industries including digital marketing, card linked rewards, identity authentication, and the credit industry.','2013-11-30 13:28:42','2014-01-08 23:48:40','Scotts_McDonough_02202010_-_Small.jpg','image/jpeg',10376,'2013-11-30 13:28:40'),
	(240,361,'John Silver','SALES REPRESENTATIVE, ABR, EPRO:  \r\n\r\n“I am originally from Western Canada (Edmonton, Alberta), went to University in the Western United States (Eugene, Oregon), moved to Montreal where I lived and worked (studying French) and immigrated to Toronto in 1976. For the most part, I have lived and worked in Downtown Toronto and though I am not native, I could not think of living anywhere else…though I could miss Toronto winters”.\r\n\r\n“I am a Sales Representative with Sotheby’s International Realty Canada and have been a member of the Toronto Real Estate Board and an active REALTOR® for 33 years. I love teaching about technology and have adopted it into my real estate business”.','2014-04-02 00:33:33','2014-08-04 14:21:12','Richard_Silver.jpg','image/jpeg',20030,'2014-04-02 00:33:32'),
	(241,361,'Kim Ezeard','Sales Representative, ABR:  \r\n\r\nKimberley is a Toronto native with neighborhood knowledge and a strong sense of community. Kimberley’s entrepreneurial skills supported by a strong work ethic and 20 years of running her own businesses have proven her business acumen. Known for excelling at client service, communication, discretion, and negotiation; when added to her energy and enthusiasm, lead her clients to successful transactions.She has traveled the world and is conversant in other cultures and the diversity that make up the Canadian Mosaic.','2014-04-02 01:05:19','2014-08-04 14:21:12','Kimberley-1-224x300.jpg','image/jpeg',28519,'2014-04-02 01:05:15'),
	(242,361,'Sherille Layton','Sales Representative:  \r\n\r\nBritish born and a dedicated Torontoian, Sherille has spent her working life in Sales. After travelling the World as an international merchandise buyer in London and Hong Kong, Sherille immigrated to Canada to use her gifts in a new endeavor, Real Estate.\r\n\r\nPassionate about homes, she also understands the merits and expectations when working with today’s International Buyers and Sellers, especially where immigration is involved.\r\n\r\nSherille has enjoyed a successful career at Bosley Real Estate Ltd. where she was recognized on the Honour Roll and in the Founders Division. She is well known as a negotiator who listens and communicates with a trustworthy approach resulting in repeated client satisfaction.','2014-04-02 01:05:20','2014-04-02 20:19:00','Sherille-Layton-photo.jpg','image/jpeg',201459,'2014-04-02 01:05:16'),
	(243,361,'Tania Bettencourt','Client Care Manager:  \r\n\r\nTania has worked on the administrative side of Real Estate for over 16 years, with all her expertise in the industry, she has the tools, background and knowledge to help Richard Silver and his team make your home buying and selling experience as smooth as possible. Tania is the friendly voice who will answer your calls and emails, and her goal is to deliver exceptional client service.\r\n\r\nTania grew up in downtown Toronto and loves exploring new neighbourhoods, her friends often call her the human GPS. She, along with her husband and children live just outside of Toronto but her roots and love for the city still remains.\r\n\r\nWorking seamlessly with Richard, Sherille, and Kimberley, Tania is devoted to helping make a significant and memorable contribution.','2014-04-02 01:05:20','2014-04-02 20:19:00','Pinpoint-DSC_0119_edited_cropped-225x300.jpg','image/jpeg',28816,'2014-04-02 01:05:18'),
	(244,47,'Kenneth O\'Hanlon Chairman & CEO','Kenneth has been working on Mobile Marketing from 2003 being the first to bring to the market mobile marketing service, showing the service in Orlando National Association of Realtors in 2004 .Then in 2010 he received the Patent US 7,643,821. Also he received in 2013 Patent US 8,437,453, Also he received in 2014 Patent US 8,774,371.Also he received in 2014 Patent US US 8,817,959. He now brings a new service in digital mobile marketing in HTML5 with the new mobi text &amp; email service O\'Hanlon has been one of leading independent Mobile text marketing for over 10 years as the Managing Director offers a wealth of experience in helping agents market and successfully selling property in Denver and the USA, which has led to O\'Hanlon continually being the market leader within Digital Mobile Marketing. O\'Hanlon and his team guarantee a high quality selling service combining modern techniques with traditional values, helping people move as smoothly as possible in a business that is often very stressful. ','2014-04-03 11:20:18','2014-09-26 07:10:16','20130331_114013.jpg','image/jpeg',65451,'2014-04-03 11:20:16'),
