	(257,5,'Marlen Otten','<p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><em style=\"margin-bottom: 0px; outline: none !important;\">Vice President Marketing</em></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><em style=\"margin-bottom: 0px; outline: none !important;\"><br></em></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">Marlen Otten is an executive marketer passionate about health and wellness. She has more than 13 years of marketing and sales experience within the nutraceutical industry, domestic as well as global product marketing knowledge of dietary supplements and functional foods.</p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">Marlen is responsible for leading the company’s marketing communication activities, including product marketing, marketing and field communications, brand management, creative services, customer relationship marketing, user experience, and social media. Marlen is also overseeing product development, vendor relations, and customer service.</p>','2014-08-09 12:18:50','2014-08-09 12:58:21','Marlen_Otten.jpg','image/jpeg',5249,'2014-08-09 12:18:47'),
	(258,5,'Martha McBride','<p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><em style=\"margin-bottom: 0px; outline: none !important;\">Vice President Sales</em></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\"><em style=\"margin-bottom: 0px; outline: none !important;\"><br></em></p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 20px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">With 20 years in the direct sales field with several companies, Martha McBride is the voice of experience. Combine her in-the-trenches lessons as a field leader with her success in corporate roles, and you’ve got a trainer and coach who understands both sides of the business and the power when they work together – one team – one dream. Her skillset and track record is unique and it makes her a great liaison between the company and the sales field.</p><p style=\"outline: none 0px; word-wrap: break-word; margin-bottom: 0px; border: 0px none; font-size: 16px; list-style-type: none; padding: 0px; font-family: \'Avant Garde\', Avantgarde, \'Century Gothic\', CenturyGothic, AppleGothic, sans-serif; color: rgb(122, 122, 122);\">A specialist in increasing growth and maximizing payout by being deliberate about your time investment, she advocates for following a proven system in the field and at the home office.</p>','2014-08-09 12:18:51','2014-08-09 12:58:21','Martha_McBride.jpg','image/jpeg',5124,'2014-08-09 12:18:49'),
