	(261,441,'t','<p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: 20px; font-style: inherit; font-variant: inherit; font-weight: bold; line-height: inherit; vertical-align: baseline;\">With Over 25 years</span>&nbsp;of history and expertise, Superior Aggregates understands the responsability of being a preferred supplier of pavement material and services. &nbsp;We continually place a high emphasis on quality, customer service and teamwork. Our employees take personal pride in their work and support the communities in which they live and work.</p><p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\">S</span>ince 1987, Superior Aggregates has provided asphalt-paving services for private and commercial projects. Our management and staff are reputable people with an abundance of expertise in all areas of paving, from the simple patch to complete paving projects. &nbsp;Reliable, knowledgeable &amp; top-notch workmanship are the qualities we bring to every project.</p><p class=\"justify\" style=\"margin-bottom: 24px; padding: 0px; border: 0px; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 24.2999992370605px; vertical-align: baseline; color: rgb(51, 51, 51);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: 600; line-height: inherit; vertical-align: baseline;\">R</span>emember, “Doing it wrong doesn’t make it right, it only makes it cheaper”. &nbsp;Give us a call today, let us help.</p>','2014-09-26 20:05:46','2014-09-26 20:15:24',NULL,NULL,NULL,NULL);
