VALUES
	(34,54,'Property For Sale','',NULL,'00000696','<i><font face=\"georgia\"><b>Fabulous</b> 24\' double aspect sitting room boasting a part-vaulted, 20\' double aspect heavily beamed separate dining room and a well-equipped double aspect kitchen. Large master bedroom which benefits from its own independent staircase and private access to the family bathroom, complemented by two further spacious bedrooms Large and attractive south facing rear gardens offering high degrees of privacy, benefiting from a detached garage approached from the rear before leading onto attractive open farmland and stunning views of the downs Wealth of character features including heavily beamed walls/ceilings, inglenook fireplaces and leaded light windows The property offers excellent potential to be extended and is sold with no ongoing chain\r\nTudor Cottage is a delightful and substantial <b>17th Century Grade ll </b>listed cottage, situated in the heart of one of the area\'s most sought after villages, offering a wealth of character features including heavily beamed walls/ceilings and inglenook fireplaces, complemented by extensive and very private rear gardens leading directly onto stunning open countryside, with a garage approached from the rear.</font></i>',NULL,3,2.0,NULL,'9','','','60','152',NULL,NULL,NULL,1700,599990,NULL,NULL,1,0,1753,'2013-03-23 08:05:28','2014-05-05 04:13:00',NULL,NULL,NULL),
	(36,56,'Property For Sale','',NULL,'AB001779','<font face=\"georgia\">Three<span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\"> spacious</font> </span>first floor bedrooms and a refitted family bathroom.Inviting entrance hall leading to sitting room with attractive fireplace, separate dining room and a well-equipped kitchen.Fabulous 18\' double-glazed conservatory overlooking the enclosed rear gardens.Front gardens providing parking facilities for several vehicles.Presented in excellent condition throughout.\r\nImpressive three bedroom family home well situated on the edge of this popular location close to nearby amenities offering many accommodation features including sitting room with attractive fireplace, separate dining room, well-equipped kitchen and a fabulous 18\' double-glazed conservatory overlooking the rear gardens.</font>',NULL,3,2.0,NULL,'6','','','60','',NULL,NULL,NULL,NULL,230000,NULL,NULL,NULL,0,1754,'2013-03-23 09:23:31','2014-05-05 04:13:14',NULL,NULL,NULL),
	(38,59,'Property For Sale','',NULL,'','<b>Security Video Entry System from Apartment 24 hour\' Emergency Careline Internal Security Alarm On-Site House </b>&nbsp;<font face=\"georgia\">Manager Lift to all floors Well Tended Communal Gardens No Onward Chain Residents Lounge\r\nA well planned and presented one bedroom first floor apartment offering spacious accommodation that includes a generous entrance hall, with alarm and video entry phone system, and access to a large storage cupboard and a three piece bathroom suite. The accommodation extends to a 15 ft Sitting Room, with balcony and contemporary fitted Kitchen and generous 16 ft Bedroom with built in wardrobes. Willow Grange is an age exclusive development for the over 55\'s that offers warden assistance and secure community living in close to Wantage Town Center, Market Place and in particularly close proximity for convenient access to Salisbury\'s shopping facilities, be that the store or the adjacent forecourt. Offered with the enormous benefit of no onward chain.&nbsp;</font>',NULL,1,1.0,NULL,'2','','','60','',NULL,NULL,NULL,NULL,120000,NULL,NULL,NULL,0,1755,'2013-03-23 18:33:28','2014-05-05 04:13:14',NULL,NULL,NULL),
	(39,64,'Property For Sale','',NULL,'AB001784','Inviting entrance hall leading to a useful ground floor cloakroom, impressive sitting room with raised fireplace and a desirable 20\' open plan kitchen/dining room boasting attractive open views to the rear.Master bedroom with en-suite shower room, two further first floor bedrooms and a family bathroom.Mains gas radiator central heating.Front gardens leading to two allocated parking spaces.Enclosed rear gardens predominantly laid to lawn before leading onto open farmland providing pleasant open views.\r\nAttractive and individual three bedroom \'barn style\' home, well situated on the edge of this small, select development offering surprisingly spacious accommodation complemented by rear gardens leading onto open farmland.\r\n',NULL,3,2.0,NULL,'10','','','60','152',NULL,NULL,NULL,NULL,274950,NULL,NULL,NULL,0,1757,'2013-03-24 22:07:55','2014-05-05 04:13:00',NULL,NULL,NULL),
	(40,65,'Property For Sale','',NULL,'AB001463','Enclosed entrance vestibule leading to inviting entrance hall, ground floor cloakroom, sitting room with attractive fireplace and separate family room.Impressive open plan kitchen/dining room.Three double first floor bedrooms complemented by well-lit and refitted family bathroom.Top floor single bedroom/study with en-suite bathroom.Front gardens providing parking facilities leading to a useful covered side area.Attractive and established rear gardens affording high degrees of privacy.Wealth of character features including sash windows (stone mullion bay windows to front aspects), high ceilings, ornamental architraving/picture rails and attractive fireplaces.\r\nStunning and substantial Edwardian four bedroom semi-detached bay fronted family home offering lovingly restored and superbly presented character accommodation over three floors, complemented by established rear gardens offering high degrees of privacy, situated in a desirable non-estate location on the edge of the nearby delightful Albert Park offering easy pedestrian access to excellent schooling and Abingdon town centre with its wide range of amenities.',NULL,4,2.5,NULL,'6','','','61','',NULL,NULL,NULL,NULL,499950,NULL,NULL,NULL,0,1758,'2013-03-24 22:35:18','2014-05-05 04:13:14',NULL,NULL,NULL),
	(41,66,'Property For Sale','',NULL,'AB001706','Ground floor security entrance leading to first floor landing. Large 16\' living room with double-glazed patio doors leading to a spacious first floor and very usable balcony. Designated dining area, kitchen, two spacious bedrooms and a refitted bathroom with white suite. Double-glazed windows and electric storage heating. Allocated and visitor\'s hard standing parking facilities complemented by communal gardens. Originally 125 year lease with 99 years remaining.\r\nImpressive larger design of modern two bedroom first floor apartment, well situated within this small, select development situated within the heart of one of the area\'s most popular villages.',NULL,2,2.0,NULL,'2','','','60','',NULL,NULL,NULL,2002,160000,NULL,NULL,NULL,0,1759,'2013-03-25 13:40:10','2014-05-05 04:13:14',NULL,NULL,NULL),
	(42,67,'Rental','',NULL,'AB001545','Very light first floor bedroom with two large double-glazed windows and a newly fitted bathroom suite including a shower/bath.Newly fitted kitchen with integrated appliances and a delightful double aspect open plan living room/dining room boasting six feature windows providing a wonderfully light and contemporary atmosphere.Double-glazed windows, no ongoing chain.A short walk to Abingdon town center offering easy access to a wide range of amenities.\r\nStunning and individual one bedroom house recently completed to high standards throughout, well situated in a convenient no-through location, close to Abingdon town center, boasting many fine features including a delightful double aspect open plan living room/dining room boasting six feature windows providing a delightfully light and contemporary atmosphere.\r\n',NULL,1,1.0,NULL,'5','','','60','','',NULL,NULL,NULL,159000,NULL,NULL,NULL,0,1760,'2013-03-25 13:59:19','2014-09-20 17:31:00',0,'One bedroom',NULL),
	(43,68,'Property For Sale','',NULL,'AB001355','Enclosed entrance porch, entrance hall, kitchen, 17\' dining room and 14\' living room.Two spacious first floor bedrooms and a bathroom.Attached garage complemented by parking facilities leading to corner plot and relatively private south west facing rear gardens.Double-glazed windows and mains gas radiator central heating.Sold with vacant possession upon completion.\r\nSubstantially extended two bedroom end of terrace house, offering unusually large ground floor accommodation complemented by corner plot south west facing gardens with garage and parking facilities for several vehicles, situated in a pleasant cul-de-sac location within this popular North Abingdon development offering easy pedestrian access to many nearby amenities.',NULL,1,1.0,NULL,'5','','','61','150',NULL,NULL,NULL,NULL,215000,NULL,NULL,1,1,1761,'2013-03-26 08:48:41','2014-05-05 04:13:00',NULL,NULL,NULL),
