	(146,304,'Rental','',NULL,'','<p style=\"margin-bottom: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-family: Lato, Helvetica, Arial, sans-serif; line-height: 21px;\">Living the dream!&nbsp;</p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-family: Lato, Helvetica, Arial, sans-serif; line-height: 21px;\"><br></p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-family: Lato, Helvetica, Arial, sans-serif; line-height: 21px;\">Sun-filled detached beach home steps to Queen Street East, parks, Lake Ontario, restaurants, transit and pubs! Stunning renovated kitchen&nbsp;and baths in 2 stories of high-end finishings. Four bedrooms, three baths, open concept living and dining room… Perfect for entertaining. Hardwood floor throughout, lots of storage, cozy recreation room with woodburning fireplace, lower level with walk-out to tread garden. Private beach and off leash dog park at end of street.</p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-family: Lato, Helvetica, Arial, sans-serif; line-height: 21px;\"><br></p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-family: Lato, Helvetica, Arial, sans-serif; line-height: 21px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Extras:&nbsp;</strong>fridge, stove, dishwasher, built-in kitchen table, bar stools, built-in surround sound (main floor and lower level), and central vacuum.</p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-family: Lato, Helvetica, Arial, sans-serif; line-height: 21px;\"><br></p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; vertical-align: baseline; font-family: Lato, Helvetica, Arial, sans-serif; line-height: 21px;\"><strong style=\"color: rgb(68, 68, 68); margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Excluded:&nbsp;</strong><font color=\"#444444\">sauna (negotiable),</font>&nbsp;<nobr><span style=\"padding-bottom: 1px !important; border-bottom-width: 1px !important; border-bottom-style: solid !important; border-bottom-color: rgb(28, 125, 255) !important;\">hanging pot rack</span></nobr>&nbsp;i<font color=\"#444444\">n kitchen.</font></p><p style=\"margin-bottom: 0px; padding: 0px; border: 0px; vertical-align: baseline; font-family: Lato, Helvetica, Arial, sans-serif; line-height: 21px;\"><font color=\"#444444\"><br></font></p>',NULL,3,3.0,NULL,'1',NULL,NULL,'60','150','',0.09,3000.00,NULL,1299,NULL,NULL,NULL,0,1893,'2014-05-21 13:09:19','2014-11-13 15:06:03',0,'Living the dream!',NULL),
